One night there are a series of explosions at the Groundstar space research facility and only one man gets out alive - most likely, the saboteur. Badly burned, he makes it as far as a nearby house and collapses - and that's just the title sequence!

Filmed in Canada, The Groundstar Conspiracy was adapted from L.P. Davies' novel &quot;The Alien&quot;. Michael Sarrazin plays a research scientist who is the sole survivor when his secret laboratory in Vancouver is destroyed by an explosion. Assuming that Sarrazin has engineered the explosion so that he can escape with vital space program secrets, the government dispatches special agent George Peppard to track down the fugitive scientist.


